SCHEMA task5;
	ENTITY auto;
		doors: INTEGER;
		mirrors: INTEGER;
		wheels: INTEGER;
		trunk: BOOLEAN; *багажник*
		brand_name: STRING; *audi*
		brand_number: STRING; *a5*
		number: STRING; *e111ee*
		region: STRING; *73*
		WHERE
			whls: wheels >= 4;
		UNIQUE
			keys: number, region, brand_name, brand_number;
	END_ENTITY;
END_SCHEMA.

SCHEMA task4;
	ENTITY romb;
		color: OPTIONAL STRING;
		length: REAL;
		sharp_angle: REAL;
		WHERE
			side: length > 0.0;
			s_a: sharp_angle > 0.0 AND sharp_angle < 90
		DERIVE
			perimetr: REAL := 4*side;
	END_ENTITY;
END_SCHEMA.

/*
	Algoritmo que permite pasar como parametro filas de una matriz, utilizando punteros
*/
#include<iostream>
#include<ctime>

using namespace std;

//Prototipos
int num_aleatorio(int, int);
void imprimir_matriz(int *, int, int);
void imprimir_fila(int *,int, int); // Prueba



int main()
{
	int m,n;
	cout<<"Numero de filas: "; cin>>m;
	cout<<"Numero de columnas: "; cin>>n;
	
	int matriz[m][n];

	int *puntero_matriz = &matriz[0][0];
	
	// Cargar Matriz
	srand(time(NULL));
	for(int i=0 ; i<m ; i++)
	{
		for(int j=0 ; j<n ; j++){
			*(puntero_matriz + i*n +j) = num_aleatorio(1,10);
		}	
	}
	
	imprimir_matriz(puntero_matriz,m,n);
	
	// Pasar filas de la matriz
	for(int i=0 ; i<m ; i++){
		imprimir_fila(puntero_matriz,i,n);
	}
		
}

int num_aleatorio(int min, int max)
{
	return (min + rand()%(max-min+1));
}

void imprimir_matriz(int *puntero_matriz, int m, int n)
{
	cout<<"=====================================\n";
	for(int i=0 ; i<m ; i++){
		for(int j=0 ; j<n ; j++){
			cout<<*(puntero_matriz+i*n+j)<<"\t";
		}
		cout<<"\n";
	}
}


void imprimir_fila(int *puntero,int k, int n)
{
	cout<<"\n";
	for(int i=0 ; i<n ; i++)
	{
		cout<<*(puntero+k*n+i)<<" ";
	}
}

